import SideNavBar from "../Components/SideNavBar";
import AppBar from "../Components/AppBar";
import Box from "@mui/material/Box";

function Books() {
  return (
    <>
      <Box sx={{ display: "flex" }}>
        <SideNavBar />
        <AppBar/>
        <Box component="main" sx={{ flexGrow: 1, p: 3 }}>
          <h1>Books</h1>
        </Box>
      </Box>
    </>
  );
}
export default Books;
